import Navbar from './components/containers/navbar/index';
import Contact from './pages/contact/index';
import { Routes, Route } from 'react-router-dom';
import './App.css';


function App() {
  return (
    <div className="App">
      <>
        <Navbar />
        <Routes>
          <Route path='home' />
          <Route path='/product' />
          <Route path='/details' />
          <Route path='/contact' element={<Contact />} />
        </Routes>
      </>
    </div>
  );
}

export default App;
